import React from 'react';

const PortfolioAnalyzer = () => {
  return (
    <div style={{
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      height: '100vh',
      backgroundColor: '#000000'
    }}>
      <div style={{
        padding: '20px',
        backgroundColor: '#ffffff',
        color: '#000000',
        borderRadius: '5px',
        fontFamily: 'Computer Says No, monospace',
        fontSize: '24px'
      }}>
        Portfolio Analyzer
      </div>
    </div>
  );
};

export default PortfolioAnalyzer;
